import { useState, useEffect } from "react";

function MeshViewer() {}

function Viewer() {
  const button_notification = (
    <div>
      <input
        type="button"
        value="완성되면 알려줄까?"
        style={{
          width: "80%",
          height: 70,
          position: "fixed",
          bottom: 0,
          margin: "10%",
          borderRadius: 30,
          backgroundColor: "yellowgreen",
          fontSize: 24,
          color: "black",
        }}
        onClick={() => {
          alert("푸시 알림 미구현 상태 (서버 통합 후 적용 예정)");
        }}
      />
    </div>
  );
  return button_notification;
}

export default Viewer;
